Defendant Willmarvin Diaz-Boria in court with attorney Mark S Rosen.  Benjamin A. Wesson appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Sentencing proceeded.  PSI Report reviewed; no corrections made.  Statements made by State, Vonnellise G., Ashley D., Merlis B., Alexis G., Gilberto F., defense ,and defendant. 
 
AS TO COUNT 1:  The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 4 1/2 YEARS, CONSECUTIVE to any other time being served with credit for 5 days served.  The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 2 1/2 YEARS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 2 YEARS.

The defendant IS eligible for the Challenge Incarceration Program and the Substance Abuse Program AFTER SERVING THE FIRST 18 MONTH OF THIS SENTENCE.

CONDITIONS OF EXTENDED SUPERVISION:
*Obtain AODA assessment and if necessary successfully complete follow-up treatment;
*Cooperate with random urine screens;
*No drug dealing or association with drug community (drug users/dealers or drug houses);
*Cooperate with any and all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*No contact with victims Aaron, R., Alexandre J.-S., Elizabeth L., Karissa H., Mitchell H. and co-actors Mary Molale, Erik Tejada, Jeriel Rodriguez, and Abigail Baez;
*Obtain/maintain full time employment or full time school and part time employment;
*Participate in Cognitive Thinking;
*Pay all supervision fees;
*Provide DNA sample- pay surcharge;
*Pay all applicable mandatory surcharges, fees, assessments, and costs- bail to apply after restitution paid; 

State in compliance with victim rights legislation.  The Court ordered restitution in the stipulated amount of $75.00 payable to Aaron R.- to be paid first/bail to apply.  Restitution is joint and several with all co-actors convicted of this offense (Abigail Baez-14CF292/Mary Molale-14CF294/Jeriel Rodriguez-14CF295/Erik Tejada-14CF296).  The Court ordered that all financial obligations and restitution be paid through collection of sums by the Department of Corrections from 25% of funds under Sec. 973.05(4)(b) and as a condition of extended supervision.  Any amount remaining due and owing is subject to civil judgment.  Pursuant to Wisconsin Statutes Section 973.176, the Court advised the defendant of the following restrictions:  Firearm possession and Voting.  Appeal rights given by the Court.
